mapper.select:

select 

from tc_sys_variable
where variable_id = #{variableId,jdbcType=VARCHAR}
  and variable_sub_id = #{variableSubId,jdbcType=VARCHAR}

mapper.delete:

delete from tc_sys_variable
where variable_id = #{variableId,jdbcType=VARCHAR}
  and variable_sub_id = #{variableSubId,jdbcType=VARCHAR}
